/* ------------------  START OF CHANGEABLE PARAMETERS --------------------- */
// setting name of this file (if setting is changed, you must remember to rename this file)
$thisFileName = "indexall.php"; 

// setting files not to list (this file and Windows and Unix-like (GNU/Linux and Mac OS X included) common system files (often set hidden by default))
$dontListFiles = array($thisFileName,".DS_Store","desktop.ini","Thumbs.db",".htaccess",".htpasswd");

// setting dirs not to list
// $dontListDirs = array( "dir1", "dir2");
$dontListDirs = array();

// filetypes considered as common image formats
$commonImageFormats = array("bmp", "gif", "ico", "jpeg", "jpe", "jpg", "png", "psd", "svg", "tif", "tiff", "xcf");

// Default and max number of columns displayed
$TDperRowDefault = 3;
$TDperRowMax = 10;

/* ------------------  END OF  CHANGEABLE PARAMETERS --------------------- */


// managing version of current php script
global $ver;
$ver = "Indexall version 1.0 - Jun 29, 2015";

// start building url string
$pageURL = 'http';

// adding secure protocol (if it's the case)
if (@$_SERVER["HTTPS"] == "on") {$pageURL .= "s";}

$pageURL .= "://";
if ($_SERVER["SERVER_PORT"] != "80")
{
	$pageURL .= $_SERVER["SERVER_NAME"].":".$_SERVER["SERVER_PORT"].$_SERVER["REQUEST_URI"];
} else
{
	$pageURL .= $_SERVER["SERVER_NAME"].$_SERVER["REQUEST_URI"];
}

// extracting url where this file is placed
$indexallFilePosition = strpos($pageURL, $thisFileName);
global $general_url;
$general_url = substr($pageURL, 0, --$indexallFilePosition);

// extracting path where this file is placed
global $general_path;
$general_path = getcwd();	
$BackSlashWithSpaces = " \ ";
$sngBackSlash = substr($BackSlashWithSpaces,1,1);
$general_path = str_replace($sngBackSlash, "/", $general_path);

$thisServerName = @$SERVER_NAME;

// simulating register_globals parameter as active (in case is set as OFF on the server)
if (!ini_get('register_globals')) {
    $superglobals = array($_SERVER, $_ENV,
        $_FILES, $_COOKIE, $_POST, $_GET);
    if (isset($_SESSION)) {
        array_unshift($superglobals, $_SESSION);
    }
    foreach ($superglobals as $superglobal) {
        extract($superglobal, EXTR_SKIP);
    }
}

