// modulating process for the creation of cell contents into the table
  
function createHtmlCodeOfCells($HtmlCodeOfCells,$fileExtension2,$butOnly,$TDwidthPerc,$baseUrl4,$fileName,$filePixels_a,$filePixels_b,$filesArr_i,$fileSizeInKb,$fileDate,$fileTimeLastMod,$fileExtension,$hiddenFileYesNo,$thisFileName)
{

	$fileName2 = str_replace("'","\'",$fileName);
	$fileName2 = str_replace("%27","\%27",$fileName);
	$baseUrl4b = str_replace("'","\'",$baseUrl4);
	$baseUrl4b = str_replace("%27","\%27",$baseUrl4);
	
	switch ($fileExtension2)
	{
		case "gif":
			if ($butOnly=="*img") {
				$HtmlCodeOfCells .= "  <td height=130 width=".$TDwidthPerc."%  align=\"center\" valign=\"top\" bgcolor=\"#FFFFFF\"><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=1><br><a href=javascript:apri('".$baseUrl4b."/".$fileName2."','".$filePixels_a."','".$filePixels_b."');><img src=".$baseUrl4."/".$fileName." border=0 alt=\"".$filesArr_i."\" width=96 height=96><br>".$filesArr_i."</a><br><br>".$fileSizeInKb." KB<BR>".$fileDate."<BR>".$fileTimeLastMod."<br>".$fileExtension."<br>W: ".$filePixels_a." x H: ".$filePixels_b."<br>&nbsp;</font></td> \n";
