function isort($a,$b)
{
	/*	isort :
			ord (http://www.php.net/manual/en/function.ord.php) returns the ASCII value of the first character in a string (the ASCII value of a capital letter is different from that of a lower case letter)
			strtolower  (http://www.php.net/manual/en/function.strtolower.php) converts all uppercase chrs in a string to lowercase
			This function compares the lower-cased first letter in one string to that in another.  We''ll use it to compare directory names
	*/
	if(ord(strtolower($a)) == ord(strtolower($b))) return 0;
	return (ord(strtolower($a))< ord(strtolower($b))) ? -1: 1;
}

function isortMultiD($a,$b)
{
	/*	isortMultiD : This function basically is the same as issort, except that it runs the comparison between the 2nd row in each array, then the first.
			We''ll be using it to sort the filenames, where the j in $filesArr[i][j] is the extension (bmp, gif, jpg, etc) and the i is the name itself.
	*/
    if(ord(strtolower($a[count($a) - 1])) == ord(strtolower($b[count ($b) - 1])))
	{
		if(ord(strtolower($a[0])) == ord(strtolower($b[0]))) return 0;
		return (ord(strtolower($a[0]))< ord(strtolower($b[0]))) ? -1: 1;
	}
	return (ord(strtolower($a[count ($a) - 1])) < ord(strtolower($b[count ($b)]))) ? -1: 1;
}

// ordering files ascending by name
function isortb($a,$b)
{
   if(($a[count($a) - 1]) == ($b[count ($b) - 1]))
	{
		if(($a[0]) == ($b[0])) return 0;
		return (($a[0])< ($b[0])) ? -1: 1;
	}
	return (($a[count ($a) - 1]) > ($b[count ($b)])) ? -1: 1;
}

function isortMultiDb($a,$b)
{
	/*	isortMultiD : This function basically is the same as issort, except that it runs the comparison between the 2nd row in each array, then the first.
			We''ll be using it to sort the filenames, where the j in $filesArr[i][j] is the extension (bmp, gif, jpg, etc) and the i is the name itself.
	*/
    if(ord($a[count($a) - 1]) == ord($b[count ($b) - 1]))
	{
		if(ord($a[0]) == ord($b[0])) return 0;
		return (ord($a[0])< ord($b[0])) ? -1: 1;
	}
	return (ord($a[count ($a) - 1]) < ord($b[count ($b)])) ? -1: 1;
}


// correcting not necessary double slashes
function slashCorrection($baseUrl)
{
	$baseUrl = str_replace("http://","http:/@",$baseUrl);
	$baseUrl = str_replace("https://","https:/@",$baseUrl);
	$baseUrl = str_replace("file://","file:/@",$baseUrl);

	$baseUrl = str_replace("http%3A%2F%2F","http%3A%2F@",$baseUrl);
	$baseUrl = str_replace("https%3A%2F%2F","https%3A%2F@",$baseUrl);
	$baseUrl = str_replace("file%3A%2F%2F","file%3A%2F@",$baseUrl);
	
	$dev = 0;

	while ($dev == 0)
	{
		$trpBackSlash = " \\\ ";
		$sngBackSlash = substr($trpBackSlash,1,1);
		$baseUrl = str_replace($sngBackSlash,"/",$baseUrl);
		$baseUrl = str_replace("%2F","/",$baseUrl);

		if ( (strpos($baseUrl,"//") != false) || (strpos($baseUrl,"%2F%2F") != false))
		{
			$baseUrl = str_replace("//","/",$baseUrl);
			$baseUrl = str_replace("%2F%2F","/",$baseUrl);
		}
		else
		{
			$dev = 1;
		}
	}

	$lastSlashPosition2 = strrpos($baseUrl, "/"); // mi dice dov'' l''_ULTIMA_ back-slash (/) dell''URL
	$baseUrlLength = strlen($baseUrl);
	if ($lastSlashPosition2 == --$baseUrlLength)
	{
		$baseUrl = substr($baseUrl, 0, $lastSlashPosition2);
	}

	$baseUrl = str_replace("http:/@","http://",$baseUrl);
	$baseUrl = str_replace("https:/@","https://",$baseUrl);
	$baseUrl = str_replace("file:/@","file://",$baseUrl);

	$baseUrl = str_replace("http%3A%2F@","http%3A%2F%2F",$baseUrl);
	$baseUrl = str_replace("https%3A%2F@","https%3A%2F%2F",$baseUrl);
	$baseUrl = str_replace("file%3A%2F@","file%3A%2F%2F",$baseUrl);

	return $baseUrl;
}

// adding protocol (if necessary)
function addProtocol ($dir, $general_url)
{
	$general_url_noprotocol = substr($general_url, strrpos($general_url, ":") + 1 , strlen($general_url));

//	$dir =  str_replace("http://127.0.0.1","http:/@",$dir);
	$dir =  str_replace($general_url,"http:/@",$dir);
//	$dir =  str_replace("127.0.0.1","http://127.0.0.1",$dir);
	$dir =  str_replace($general_url_noprotocol,$general_url,$dir);
//	$dir =  str_replace("http:/@","http://127.0.0.1",$dir);
	$dir =  str_replace("http:/@",$general_url,$dir);
	return $dir;
}


// translating a path with corresponding url on server
function getThisURL($general_path,$general_url)
{
	// reading current path
	$thisPath = getcwd();

	// reading current dir name
	$thisPathLength = strlen($thisPath);
	$lastSlashPosition = strrpos($thisPath, "/"); // find last backslash
 	$thisDirLength = $thisPathLength - $lastSlashPosition;
  	$thisDir = substr($thisPath, $lastSlashPosition, $thisDirLength);

//	$baseUrl = str_replace("c:\programmi\easyphp\www","http://127.0.0.1",$thisPath);
	$baseUrl = str_replace($general_path,$general_url,$thisPath);

	$baseUrl = slashCorrection($baseUrl);  // correcting wrong slashes
	return $baseUrl;
}

// translating a url with corresponding path on server
function urlToPath($chosenDir,$general_path,$general_url)
{
	global $dir;
	if ($dir == "")
	{
		$pathChosenDir = getcwd();
	}
	else
	{
//		$baseUrl = str_replace("http://127.0.0.1","c:\programmi\easyphp\www",$chosenDir);
		$baseUrl = str_replace($general_url,$general_path,$chosenDir);
		$pathChosenDir = $baseUrl;
	}
	return $pathChosenDir;
}


// checking inserted path and translating into corresponding url
function pathToUrl($dir,$general_url,$general_path)
{
	global $dir;
	if ($dir == "")	{
			$dir = getcwd();
	}
	$dir= slashCorrection($dir);

	//	 $dir2 = str_replace("c:/programmi/easyphp/www","http://127.0.0.1",$dir);
	$dir2 = str_replace($general_path,$general_url,$dir);

	// avoid going up reading directories
	if ( (strpos($dir2, "/") == 0) || (strpos($dir2, ":") == 1) )	{
		$dir2 = "[".$dir2."]";
	}
	$dir = $dir2;
	return $dir;
}

